description:
Al Capone: Icon

Biography Documentary hosted by Chip Bolcik, published by PBS in 2014 - English narration


Information
------------------------------

This totally new series connects generations through profiles of legends like Frank Sinatra and Al Capone in a way you've never seen them before. This series isn't just about where they were born or how much money they made. The driving force of every episode of AMERICAN ICONS is our legends' enduring impact!
Al Capone -- the quintessential self-made American man, ruthless killer or both? Just his name sparks images of pin-stripe suits and bloody violence. To this day, Americans are fascinated by this celebrity gangster. The question is why?

